import { Link } from "react-router-dom";


const Card = ({ id, name, image, subregion }) => {
    return(
        <div>
            <Link to={`/${id}`} className="name">
                <h1>{name}</h1>
            </Link>

            <img src={image.url} alt="" className="flag" />

            <div>
                <h2>{name}</h2>
                <h2>{subregion}</h2>
            </div>
        </div>
    )
}

export default Card;
